import React from 'react';
import axios from 'axios';
import dynamic from 'next/dynamic';
import {Button} from 'react-bootstrap'

export default class Index extends React.Component {

  getCoords = 'http://localhost:3001/taras/coordinates';


  constructor(props) {
    super(props)
    this.state = {
      geojson: {}
    }

  }

  login(e){
      console.log(e.target.getAttribute("data-username"))
  }

  render() {
    return (
      <div>
        <div style={{width:300,height:200,backgroundColor:"white",position:"fixed",borderRadius:20, textAlign:"center"}}>
          <h1>
            Login
          </h1>
          <input id="username" type = "email"></input>
          <input id="password" type = "password"></input>
          <br></br>
          <Button data-username='#username' value="Login" onClick={(e) => this.login(e)}>Login</Button>
        </div>
      </div>
    )
  }
}
